  public static function exportNotProgess($fileName, $data, $headers) {
    Excel::create($fileName, function($reader) use($data, $headers)
    {
      $reader->sheet( 'Review',function($sheet) use($data, $headers) {
        
        $sheet->cells('A1:Y1', function($cell) {
            $cell->setBackground('#2494F2');
            $cell->setFontFamily('Arial');
            $cell->setFontSize(16);
            $cell->setFontWeight('bold');
            $cell->setFontColor('#ffffff');
          });
        $sheet->setAutoSize(true);
        $row1 = [];
        foreach ($headers as $header) {
          $row1[] = '1';
        }


        $sheet->row(1, $headers);
         $sheet->rows($row1);
         foreach ($data as $value) {
          $sheet->appendRow($value);
         }

      });
    })->store('xlsx', public_path('/'));

  }

